function Letter({ letter, searchLetter, disabLetter }) {
    const trackingLetterHandler = (e) => {
        const tracking = e.target.innerHTML;
        searchLetter(tracking);
    };

    const disLetter = (e) => {
        const isDisabled = disLetter.includes(e.target.innerHTML)
            ? true
            : false;
        return isDisabled;
    };

    return (
        <button
            className="letter"
            onClick={trackingLetterHandler}
            disabled={disLetter}
        >
            {letter}
        </button>
    );
}

export default Letter;
